import React from "react";
import styled from "styled-components";

const StyledNav = styled.nav`
  background-color: #070814;
  height: 82px;
  width: 100%;
  display: flex;
  justify-content: center;
  align-items: center;

  .div-css {
    display: flex;
    justify-content: space-between;
    align-items: center;
    width: 90%; // 기본적으로 화면 너비의 90% 사용
    max-width: 1240px; // 최대 너비 설정
    position: relative;
  }

  .link {
    display: flex;
    justify-content: center;
    align-items: center;
  }

  .image {
    background-image: url(./image.png);
    background-position: 50% 50%;
    background-size: cover;
    height: 19px;
    width: 154px; // 이미지 크기 조정이 필요할 수 있음
  }

  .list {
    display: flex;
    gap: 20px; // 항목 간격
  }

  .item, .item-button {
    background-color: transparent;
    display: flex;
    justify-content: center;
    align-items: center;
    height: 42px;
    padding: 0 15px; // 좌우 패딩으로 항목 크기 조정
    cursor: pointer;
  }

  .item-button {
    background-color: #343744;
    margin-left: auto; // 버튼을 오른쪽으로 밀어냄
  }

  .div, .link-about, .text-wrapper {
    color: #ffffff;
    font-family: "Pretendard-Medium", Helvetica, sans-serif;
    font-size: 18px;
    font-weight: 500;
    letter-spacing: -0.18px;
    line-height: 25.2px;
    white-space: nowrap;
  }

  @media (max-width: 768px) {
    .div-css {
      flex-direction: column;
      gap: 20px; // 세로 방향으로 항목 배치 시 간격
    }

    .list {
      flex-direction: column;
      align-items: center;
    }

    .item, .item-button {
      width: 100%; // 모바일 화면에서는 너비를 100%로 조정
    }
  }
`;

export const Header = () => {
  return (
    <StyledNav>
      <div className="div-css">
        <div className="link">
          <div className="image" />
        </div>
        <div className="list">
          <div className="item">
            <div className="link-about">About</div>
          </div>
          <div className="item">
            <div className="text-wrapper">모집안내</div>
          </div>
          <div className="item">
            <div className="text-wrapper">프로젝트</div>
          </div>
          <div className="item-button">
            <div className="div">지원하기</div>
          </div>
        </div>
      </div>
    </StyledNav>
  );
};

export default Header;
